def solve():
    try:
        pauli_stabilizers = [stim.PauliString(s) for s in stabilizers]
        t = stim.Tableau.from_stabilizers(pauli_stabilizers, allow_underconstrained=True, allow_redundant=True)
        c = t.to_circuit()
        with open("circuit_108.stim", "w") as f:
            print(c, file=f)
        print("Circuit saved to circuit_108.stim")
    except Exception as e:
        print(f"Error: {e}")

if __name__ == "__main__":
    solve()
